import Link from 'next/link';

const Menu = () => {
    return (
        <ul>
            <Link href="">

            </Link>
            <li><a src="/">Home</a></li>
            <li><a src="/sobre">Sobre</a></li>
            <li><a src="/contato">Contato</a></li>
        </ul>
    );
}

export default Menu;
